import React from "react";
import { Card } from "../../Card.styled";
const NavBar = () => {
  return (
    <>
      <Card bd={"1px solid black"} height={"2rem"} mg={"2rem"}>
        <Card
          bd={"1px solid red"}
          width={"50%"}
          height={"90%"}
          mg={"none"}
          dp={"inline-block"}
        ></Card>
        <Card
          float={"right"}
          bd={"1px solid red"}
          width={"49%"}
          height={"90%"}
          dp={"grid"}
        >
          <Card></Card>
        </Card>
      </Card>
    </>
  );
};

export default NavBar;
